    # 省市联动城市列表
    def onActivatedCity(self, index):
        self.citycomboBox.clear()
        self.citycomboBox.addItem(u'请选择')
        self.towncomboBox.clear()
        self.towncomboBox.addItem(u'请选择')
        data=self.provinceComboBox.itemData(index)
        for (keys, val) in self.dictCity[data].items():
            self.citycomboBox.addItem(val, QVariant(keys))
    
    # 城市联动区县列表
    def onActivatedTown(self, index):
        self.towncomboBox.clear()
        self.towncomboBox.addItem(u'请选择')
        
        intdata=self.citycomboBox.itemData(index)
        for (keys, vald) in self.dictTown[intdata].items():
            self.towncomboBox.addItem(vald,QVariant(keys))
        
